function Intro() {
    return (
        <div id="intro-box">
            <img id="intro-bg-img" src="images/illustration-working.svg" alt="working illustration" />
            <h1 id="intro-title"> More than just shorter links</h1>
            <p id="intro-paragraph"></p>

        </div>
    )
}








export default Intro;
